$(document).ready(function(){$.getJSON("/conversion.json",function(n){var a=[];$.each(n,function(n,t){var s=t.column;switch(s){case"1":s="one column";break;case"2":s="two columns";break;case"3":s="three columns";break;default:s="undefined columns"}var e=s.replace(" ","-"),r=t.status?"cnv-done":"cnv-progress";a.push('<li class="'+n+" "+e+" "+r+'"><span><strong>Ticket:</strong> <a href="https://crm.justia.com/case/'+t.ticket+'" target="_blank">'+t.ticket+'</a></span><span><strong>Client:</strong> <a href="'+t.url+'" target="_blank">'+t.client+'</a></span><span><strong>URL:</strong> <a href="'+t.url+'" target="_blank">'+t.url+"</a></span><span><strong>Designer:</strong> "+t.designer+"</span><span class=columns_type><strong>Columns:</strong> "+s+'</span><span class="tempname"><strong>Template:</strong> <a href="http://'+t.template+'.justia.net/" target="_blank">'+t.template+"</a></span></li>")}),$(".wrapper").html(a.join(""))})});